import React, { useEffect, useState } from "react";
import "./Pages.css";

const Computers = () => {
  const [telBrands, setTelBrands] = useState([]);
  const [tel, setTel] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch("/db.json");
        const data = await response.json();
        console.log("Data", data);
        setTelBrands(data.data.telBrendler);
      } catch (error) {
        console.error("error fetching data", error);
      }
    };
    fetchData();
  }, []);

  useEffect(() => {
    const telData = async () => {
      try {
        const res = await fetch("/db.json");
        const item = await res.json();
        console.log("teldata", item);
        setTel(item.telephones);
      } catch (error) {
        console.error("error data", error);
      }
    };
    telData
  }, []);

  return (
    <div className="telephones">
      <div className="left">
        <ul>
          <li>
            <strong>Brendlər</strong>
          </li>
          {telBrands ? (
            telBrands.map((data) => <li key={data.id}>{data.telBrendler.name}</li>)
          ) : (
            <li>Yüklənir...</li>
          )}
        </ul>
      </div>

      <div className="right"></div>
    </div>
  );
};

export default Computers;
